import {useState} from 'react';

import { Card, Switch } from 'antd';
import 'antd/dist/antd.css';

function App() {
  const [denomination, setDenomination] = useState(false);

  function onChange(value) {
    setDenomination(value);
  }

  return (
    <Card title="ATM Machine" style={{ width: 300, textAlign: "center", margin: "auto" }}>
      <Switch onChange={onChange} unCheckedChildren="Denomination" checkedChildren="Denomination"/>
      <p>{denomination}</p>
    </Card>
  );
}

export default App;
